import React, { useState } from 'react';
import axios from 'axios';
import './GenerateText.css'; // Import the CSS file for styling

const GenerateText = () => {
  const [start, setStart] = useState('');
  const [numSamples, setNumSamples] = useState(10);
  const [maxNewTokens, setMaxNewTokens] = useState(50);
  const [temperature, setTemperature] = useState(1.0);
  const [generatedText, setGeneratedText] = useState('');

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await axios.post('http://localhost:5001/generate', {
        start,
        num_samples: numSamples,
        max_new_tokens: maxNewTokens,
        temperature,
      });
      console.log('Response from backend:', response.data);
      if (response.data.error) {
        console.error('Backend error:', response.data.error);
        setGeneratedText(`Error: ${response.data.error}`);
      } else {
        setGeneratedText(response.data.generated_text);
      }
    } catch (error) {
      console.error('Request error:', error);
      console.error('Error response:', error.response?.data);
      setGeneratedText(`Error: ${error.response?.data?.error || error.message}`);
    }
  };

  return (
    <div className="container">
      <div className="card">
        <h1>Generate Text</h1>
        <p>This model is trained on Shakespeare's text dataset.</p>
        <form onSubmit={handleSubmit}>
          <div className="form-group">
            <label>Enter start text</label>
            <input
              type="text"
              value={start}
              onChange={(e) => setStart(e.target.value)}
              required
            />
          </div>
          <div className="form-group">
            <label>Number of samples</label>
            <input
              type="number"
              value={numSamples}
              onChange={(e) => setNumSamples(e.target.value)}
              required
            />
          </div>
          <div className="form-group">
            <label>Max new tokens</label>
            <input
              type="number"
              value={maxNewTokens}
              onChange={(e) => setMaxNewTokens(e.target.value)}
              required
            />
          </div>
          <div className="form-group">
            <label>Temperature</label>
            <input
              type="number"
              value={temperature}
              onChange={(e) => setTemperature(e.target.value)}
              required
            />
          </div>
          <button type="submit">Generate</button>
        </form>
        {generatedText && (
          <div className="output">
            <h2>Generated Text</h2>
            <p>{generatedText}</p>
          </div>
        )}
      </div>
    </div>
  );
};

export default GenerateText;
